//create a function to check username and password
import {validateUsername, validatePassword} from "./Validation.js"
function LoginCheck(username, password) {
    var checkUsername = validateUsername(username)
    var checkPassword = validatePassword(password)
    if(checkUsername == null || checkPassword ==null){
        alert("Login Successful")
    }
}

//export function LoginCheck
export {LoginCheck}
